import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import SuperAdminApp from './adminApps/SuperAdminApp'
import ResellerAdminApp from './adminApps/ResellerAdminApp';
import ClientAdminApp from './adminApps/ClientAdminApp';

const App = () => {
  // Example logic to determine which admin app to render based on user type
  const userType = sessionStorage.getItem('userType');

  return (
    <Router>
      <Routes>
        {userType === 'superAdmin' && <Route path="/" element={<SuperAdminApp />} />}
        {userType === 'resellerAdmin' && <Route path="/" element={<ResellerAdminApp />} />}
        {userType === 'clientAdmin' && <Route path="/" element={<ClientAdminApp />} />}
      </Routes>
    </Router>
  );
};

export default App;
